import { StyleSheet, Text, View, Button } from "react-native";

export default function Stats({ navigation }) {
  return (
    <View style={styles.container}>
      <View style={styles.typeSection}>
        <Text style={styles.header}>Data type</Text>

        {/* Health */}
        <View style={{ flexDirection: "row" }}>
          <Text style={[styles.fontNormal, { color: "blue" }]}>⎯ </Text>
          <Text style={styles.fontNormal}> Health</Text>
        </View>
        {/* Politics */}
        <View style={{ flexDirection: "row" }}>
          <Text style={styles.fontNormalRed}>⎯ </Text>
          <Text style={styles.fontNormal}> Health</Text>
        </View>
      </View>
      <View style={styles.graphSection}>
        <Text>Test</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    alignItems: "center",
    justifyContent: "center",
    flexDirection: "row",
    backgroundColor: "#FFFFFF",
    width: "100%",
    height: "100%",
    padding: 30,
  },

  //Datetype section
  typeSection: {
    flex: 5,
    width: "100%",
    height: "100%",
    backgroundColor: "#EFF5FD",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "flex-start",
    borderRadius: 15,
    padding: 20,
  },

  header: {
    fontWeight: "bold",
    fontSize: 25,
    marginBottom: 50,
  },

  fontNormal: {
    fontSize: 18,
    fontWeight: "bold",
  },

  fontNormalRed: {
    fontSize: 18,
    color: "red",
    fontWeight: "bold",
  },

  //Graph section
  graphSection: {
    flex: 10,
    width: "100%",
    height: "100%",
    backgroundColor: "#EFF5FD",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "flex-start",
    padding: 20,
    borderRadius: 15,
    marginLeft: 30,
  },
});
